import React from 'react';
import styles from './Header.module.css';

type HeaderProps = {
    className?: string;
};

const Header: React.FC<HeaderProps> = ({ className }) => {
    return (
        <header className={`${styles.header} ${className}`}>
            {}
        </header>
    );
};
export default Header;
